import "./Footer.css";
import { navigation } from "../../constants";

export const Footer = () => {
  return (
    <footer className="header">
      LOGO
      <nav>
        <ul>
          {navigation.map((item, index) => (
            <li key={index}>
              <a href="/">{item.title}</a>
            </li>
          ))}
        </ul>
      </nav>
    </footer>
  );
};
